import React, { useState } from "react";


export default function SearchPhotos() {
    const [query, setQuery] = useState("");
    console.log(query);


    let headers = new Headers();
    headers.append('x-api-key','jiVJQZYBAQa7DAi0PNYHj8lDrVHG5ADn1tYgS3Xu');
    // headers.append('Origin','http://localhost:3000');
    // headers.append("Access-Control-Allow-Origin", "*");
    // headers.append("Access-Control-Allow-Methods", "DELETE, POST, GET, OPTIONS");
    // headers.append("Access-Control-Allow-Headers", "Content-Type, Authorization, X-Requested-With");

    // console.log(headers);


    fetch('https://ri9wp1d2z2.execute-api.us-east-1.amazonaws.com/a2/search?q=apple dog',
            {   headers: headers,
                mode: 'cors'
            }
        )
        .then(response => response.json())
        .then(data => console.log(data));

    return (
        <>
        <form className="form"> 
            <label className="label" htmlFor="query"> </label>
            <input
                type="text"
                name="query"
                className="input"
                placeholder={`Try "dog" or "apple"`}
                value={query}
                onChange={(e) => setQuery(e.target.value)}
            />
            <button type="submit" className="button">Search</button>
        </form>

        </>
    );
}
